import { Component } from '@angular/core';
import { AuthService } from '../auth.service';
import {Router} from '@angular/router';
@Component({
  selector: 'app-recent',
  templateUrl: './recent.component.html',
  styleUrls: ['./recent.component.css']
})
export class RecentComponent {
  scoreList: any;

  constructor(private ScoreService: AuthService, private router : Router) {
    this.scoreList = [];
  }

  ngOnInit(): void {
      this.getAllScores();
  }

  getAllScores() {
    this.ScoreService.getScoreDetails().subscribe((result: any) => {
      this.scoreList = result;
      console.log(this.scoreList);
    });
  }
onSelect(score: { id: any; }){
  this.router.navigate(['/scoreList',score.id]);
}
}
